import React, {useContext} from 'react';
import BackButton from './BackButton';
import SettingsContext from './SettingsContext';

function Settings(onClose) {
    const settingsInfo = useContext(SettingsContext);

  return (
    <div className = 'settings'>
        <label> work interval: {settingsInfo.workMinutes}:00</label>

        <input 
        type='number' 
        placeholder='minutes' 
        min='1' max='120' 
        name='number' 
        className='minInput'
        value = {settingsInfo.workMinutes}
        onChange={event => settingsInfo.setWorkMinutes(event.target.value)}
        />

        <label> break interval: {settingsInfo.breakMinutes}:00</label>

        <input type='number'
        placeholder='minutes'
        min='1'
        max='120' 
        name='number' 
        className='minInput'
        value = {settingsInfo.breakMinutes}
        onChange={event => settingsInfo.setBreakMinutes(event.target.value)}/>
        <div>
            <BackButton onClick={() => settingsInfo.setShowSettings(false)}/> 
            <BackButton onClick={onClose}/> 
        </div>

    </div>
  )
}

export default Settings;
